import React from "react";
import "./homepage.css";

function homePage(){
    return(
        <div className="wrapper">
            <header>
                <nav>
                    <div class="nav-wrapper">
                    <a href="#!" class="brand-logo"><i class="material-icons">cloud</i>JobHuntr</a>
                    <ul class="right hide-on-med-and-down">
                        <a href="/login"><i class="material-icons">assignment_ind</i>Login</a>
                        <a href="/register"><i class="material-icons">assignment</i>Register</a>
                    </ul>
                    </div>
                </nav>
            </header>
            <h1>Welcome to JobHuntr</h1>
        </div>
    )
}

export default homePage;
